import './App.css';
import Header from './components/Header';
import Contact from './pages/Contact';
import Events from './pages/Events';
import Team from './pages/Team';
import Sponsors from './pages/Sponsors';
import History from './pages/History';

import HeroHomepage from './components/HeroHomepage';
import ImageContainerHomepage from './components/ImageContainerHomepage';
import WhoAreWeHomepage from './components/WhoAreWeHomepage';
import Footer from './components/Footer';
function App() {
  return (
    <div className="App">

      <Router>
      <Header />
      <HeroHomepage/>
      <ImageContainerHomepage/>
      <WhoAreWeHomepage/>
      <Footer/>
      <Switch>
        <Route path="/team" component={Team} />
        <Route path="/events" component={Events} />
        <Route path="/history" component={History} />
        <Route path="/sponsors" component={Sponsors} />
        <Route path="/contact" component={Contact} />
        <Route path="/" exact component={Home} /> {/* Assuming you have a Home component */}
      </Switch>
    </Router>
    </div>
  );
}

export default App;
